class Params {
  double? fajr;
  double? isha;

  Params({this.fajr, this.isha});

  factory Params.(
    Map<String, dynamic> json,
  ) {
    return Params(
      fajr: (json['Fajr'] as num?)?.toDouble(),
      isha: (json['Isha'] as num?)?.toDouble(),
    );
  }

  Map<String, dynamic>
  () {
    return {'Fajr': fajr, 'Isha': isha};
  }
}
